import React, { useEffect } from "react";
import "./PageNotFound.scss";

import $ from "jquery";

import ImgNumber from "../../assets/404page/404.svg";
import ImgHuman from "../../assets/404page/illustraion.svg";
import { MDBContainer } from "mdbreact";

function PageNotFound() {
  useEffect(() => {
    $(".not-found-page").mousemove(function (e) {
      console.log("====================================");
      console.log("x = " + e.offsetX + " :::: y = " + e.offsetY);
      console.log("====================================");
      console.log("====================================");
      console.log(
        "widht = " +
          e.target.offsetWidth +
          " :::: heigth = " +
          e.target.offsetHeight
      );
      console.log("====================================");

      $(".img-number").css({
        left:
          e.offsetX > e.target.offsetWidth
            ? 50 + e.offsetX / 400 + "%"
            : 50 - e.offsetX / 400 + "%",
        top:
          e.offsetY > e.target.offsetHeight
            ? 50 + e.offsetY / 200 + "%"
            : 50 - e.offsetY / 200 + "%",
      });
      $(".img-human").css({
        left:
          e.offsetX > e.target.offsetWidth
            ? 50 - e.offsetX / 400 + "%"
            : 50 + e.offsetX / 400 + "%",
        top:
          e.offsetY > e.target.offsetHeight
            ? 50 - e.offsetY / 200 + "%"
            : 60 + e.offsetY / 200 + "%",
      });
    });
  }, []);

  return (
    <div className="not-found-page">
      <MDBContainer>
        {" "}
        <div className="my-5 w-100 pt-5">
          <h1 className="w-100 text-center font-weight-bold">
            Your selected products
          </h1>
        </div>
      </MDBContainer>
      <div className="images-wrap-box">
        <img src={ImgNumber} className="img-number" alt="number" />
        <img src={ImgHuman} className="img-human" alt="human" />
      </div>
    </div>
  );
}

export default PageNotFound;
